<!DOCTYPE html>

<html lang="en">

    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <meta http-equiv="X-UA-Compatible" content="ie=edge">
        <title>Resonant Singularities</title>
        <!-- <link rel="stylesheet" href="style.css"> -->

        <link rel="stylesheet" href="https://cdn.jsdelivr.net/gh/jgthms/minireset.css@master/minireset.min.css">
        <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Atma:300,400,600,700">
        <!-- <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Sofia"> -->

        <style>



            body {
                background-color: #ffe5ef; /* coral; */
                background-color: coral;
                margin: 0px 0px;
                padding: 0px 0px;
                
                background: repeating-linear-gradient(
                    -45deg,
                    #ffd5e5,
                    #ffd5e5 100px,
                    #ffe5ef 100px,
                    #ffe5ef 200px


                );

                /* background: repeating-linear-gradient(
                    -45deg,
                    #803300,
                    #803300 100px,
                    #aa4400 100px,
                    #aa4400 200px

                ); */

                background-attachment: fixed;
                  
            }

            div.container {
                width: auto;
                margin: 20px;
                /* display: flex;
                align-items: center;
                justify-content: center; */
            }

            div.top {
                border-radius: 2rem 2rem 0 0;
                line-height: 1.25;
            }

            div.bot {
                border-radius: 0 0 2rem 2rem;
            }

            div.top, div.mid, div.bot {
                max-width: 1025px;
                background-color: #ffe6d5;
                margin: 0 auto;
                padding: 20px 20px;
                width: 95%;
                /* display: flex;
                align-items: center;
                justify-content: center; */
                font-family: "Atma", sans-serif;
                font-weight: 700;
                text-align: center;
                color: #ff2a7f;
            }


            @media screen and (min-width: 1024px) {
                div.top {
                    font-size: 6rem;
                }
            }

            @media screen and (max-width: 1024px) {
                div.top {
                    font-size: 4rem;
                }
            }

            @media screen and (max-width: 768px) {
                div.top {
                    font-size: 2.8rem;
                }
            }

            @media screen and (max-width: 480px) {
                div.top {
                    font-size: 1.8rem;
                }
            }

            div.mid {
                max-width: 1025px;
                background-color: #ffccaa;
                color: #803300;
                font-weight: 400;
                text-align: left;

                background-color: rgba(255,204,170, 0.789);

                padding-top: 80px;
            }

            @media screen and (min-width: 1024px) {
                div.mid, div.bot {
                    font-size: 2.4rem;
                }
            }

            @media screen and (max-width: 1024px) {
                div.mid, div.bot {
                    font-size: 1.65rem;
                }
            }

            @media screen and (max-width: 768px) {
                div.mid, div.bot {
                    font-size: 1.4rem;
                }
            }

            div.bot {
                max-width: 1025px;
                background-color: #ffb380;
                color: #803300;
                font-weight: 400;
                text-align: center;
            }


            div.box {
                border-radius: 2rem;
                padding: 1rem 1rem;
                margin: 1rem 1rem;
            }

            div.mid > div.box {
                background-color: #ffb380;
                padding-left: 2.5rem;
                /* padding-right: 0; */
            }

            div.bot > div.box {
                background-color: #ffccaa;
            }

            ul li::before {
                content: "\2022";  /* Add content: \2022 is the CSS Code/unicode for a bullet */
                color: #ff2a7f; /* Change the color */
                font-weight: bold; /* If you want it to be bold */
                display: inline-block; /* Needed to add space between the bullet and the text */
                width: 1.0em; /* Also needed for space (tweak if needed) */
                margin-left: 0.0em; /* Also needed for space (tweak if needed) */
            }

            #femail {
                width: 60%;
                padding: 10px 20px;
                margin: 5px auto;
                border: none;
                outline: none;
                border-radius: 2rem;
                /* box-sizing: border-box; */
                font-family: "Atma", sans-serif;
                font-weight: 300;
                text-align: center;
                background-color: #ffe6d5;
                color: #2b1100;
            }

            #femail:focus {
                border: none;
                outline: none;
            }

            #subscribe {
                margin: 5px auto;
                background-color: #ff2a7f;
                color: #ffaacc;
                display: block;
                height: 60px;
                font-weight: 700;
                line-height: 60px;
                text-decoration: none;
                width: 60%;
                text-align: center;
                border-radius: 2rem;
            }

            @media screen and (min-width: 1024px) {
                #subscribe  {
                    height: 60px;
                    line-height: 60px;
                    font-size: 2.4rem;
                }
                #femail {
                    height: 55px;
                    font-size: 2.4rem;
                }
            }

            @media screen and (max-width: 1024px) {
                #subscribe  {
                    height: 50px;
                    line-height: 50px;
                    font-size: 1.65rem;
                }
                #femail {
                    height: 45px;
                    font-size: 1.65rem;
                }
            }

            @media screen and (max-width: 768px) {
                #subscribe  {
                    height: 40px;
                    line-height: 40px;
                    font-size: 1.4rem;
                }
                #femail {
                    height: 35px;
                    font-size: 1.4rem;
                }
            }

            @media screen and (max-width: 480px) {
                #subscribe  {
                    height: 30px;
                    line-height: 30px;
                    font-size: 1.2rem;
                }
                #femail {
                    height: 35px;
                    font-size: 1.2rem;
                }
            }

            .tile {
                opacity: 0;
                /* transform-origin: 50% 50%; */
            }

            .object {
                opacity: 0;
                /* transform-origin: 50% 50%; */
            }

            #layer5 {
                opacity: 0.69;
                /* fill-opacity: 0; */
            }
/* 
            #layer3 {
                opacity: 0.75;
            } */

            #layer3 > .unwalkable {
                opacity: 0;
            }

            .triangle-top {
                position: absolute;
                margin: 0 0;
                top: 0;
            }

            .triangle-bot {
                position: absolute;
                margin: 0 0;
                top: auto;
                bottom: 0;
            }

            div.triangle {
                position: relative;
                max-width: 1025px;
                margin: 0 auto;
                padding: 0 0;
                width: 95%;

                background-color: rgba(255,204,170, 0.789);
            }


        </style>
    </head>

        <script>

            var seed = 0;
            var mod = 1024 * 64 + 1;

            function lcg() {
                seed = (75 * seed + 74) % mod;
                return seed;
            }

            var objectDelays = [];
            for (let o of document.querySelectorAll('.object')) {
                objectDelays.push(0);
            }

            function createTileAnimation() {

                const baseDuration = 1000;

                // console.log(floorDiv)
                // console.log(floorWidth)

                var i = 0;
                for (i= 0; i < objectDelays.length; i++) {
                    objectDelays[i] = (baseDuration / 2) * (lcg() / mod);// + baseDuration / 10;
                }

                // console.log(objectDelays);

                var tl2 = anime.timeline({
                    // easing: 'easeOutExpo',
                    // duration: 3000,
                    loop: false
                });

                // Add children
                tl2
                .add({
                    targets: '.tile',
                    translateY: [{value: [100, 0], easing: 'easeOutElastic'}],
                    delay: function(el) {
                        let x = +el.getAttribute('data-x');
                        let y = +el.getAttribute('data-y');
                        return (x + 2.5 * y) / 5 * baseDuration / 2
                    },
                    duration: baseDuration * 2,
                    opacity: [{value : [0, 1], easing: 'easeOutExpo'}],
                    scaleY: [
                        {value: 0.8, duration: baseDuration * 2 / 5}, 
                        {value: 1.0, duration: baseDuration * 3 / 5}],
                    scaleX: [
                        {value: 0.8, duration: baseDuration * 2 / 5}, 
                        {value: 1.0, duration: baseDuration * 3 / 5}],
                    easing: 'easeOutQuint'
                })
                .add({
                    targets: '.object',
                    translateY: [{value: [-50, 0], easing: 'easeOutBounce'}],
                    delay: function(el, i) { return objectDelays[i]; },
                    scaleY: [
                        {value: 1.1, duration: baseDuration * 2 / 3}, 
                        {value: 0.9, duration: baseDuration * 1 / 6},
                        {value: 1.0, duration: baseDuration * 1 / 6}],
                    scaleX: [
                        {value: 0.9, duration: baseDuration * 2 / 3}, 
                        {value: 1.1, duration: baseDuration * 1 / 6},
                        {value: 1.0, duration: baseDuration * 1 / 6}],


                    duration: baseDuration * 2,
                    opacity: [{value : [0, 1], easing: 'easeOutExpo'}],
                    easing: 'easeOutQuint'
                })
                .add({
                    duration: baseDuration * 2
                }).add({
                    targets: ['.tile', '.object'],
                    opacity: [{value: [1, 0], easing: 'easeOutExpo'}],
                    duration: baseDuration * 1.5
                });

                tl2.finished.then(createTileAnimation)
            }

            createTileAnimation()

        </script>
